import React from 'react';
import './AboutSection.css';
function AboutSection() {
  return (
    <>
  {/* Our Groomers */}
  <div className="w3-container w3-light-grey">
    <div className="w3-row-padding">
    <h3>Our Groomers</h3>
                <p>Our grooming professionals are the heart and soul of our service, combining years of experience with
                    a genuine love for animals. Trained in the latest grooming techniques, they understand the unique
                    needs of different breeds, ensuring your pet receives a tailor-made grooming experience. Their
                    caring touch and skilled hand will leave your pet looking fabulous and feeling loved!</p>

    </div>
  </div>
</>

  );
}

export default AboutSection;
